import axios from 'axios';

export function getAllDogs(){
    return async function(dispatch){
        var json = await axios('http://localhost:3001/api/dogs'); //conexion btween front and back

        return dispatch({
            type: 'GET_ALL_DOGS',
            payload: json.data
        })

    }
}
